import React from "react";
import "./../css/style.css"


function Learn() {
  return (
    <div className="learn-container">

      <h2 className="text-center">Learn more</h2>
      <ul>
<li> </li>
        <p> <strong> email : </strong> <a href="fanuelnalem@outlook.com"> fanuelnalem@outlook.com</a>  </p>
        <p> <strong> linkedIn :</strong> <a href="https://www.linkedin.com/in/fanuel-alem-12991b32/">https://www.linkedin.com/in/fanuel-alem-12991b32/</a> </p>
        <p> <strong> Github :</strong> <a href="https://github.com/fanuelalem">https://github.com/fanuelalem</a> </p>


      </ul>
    </div>
  );
}

export default Learn;
